import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css'; // Asegúrate de que este archivo esté correctamente importado

const Navbar = () => {
    return (
        <nav className="navbar navbar-expand-lg fixed-top">
            <div className="container-fluid">
                <Link to="/">
                    <img src="./images/LOGUITO-TECSWAP.png" alt="tecswap" style={{ height: '40px'}} />
                </Link>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav mx-auto">
                        <li className="nav-item">
                            <Link className="nav-link" to="/">Inicio</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/misproductos">Mis productos</Link>
                        </li>
                        <li className="nav-item" style={{ marginRight: '40px' }}>
                            <Link className="nav-link" to="/sobre">Sobre nosotros</Link>
                        </li>
                    </ul>
                    <Link className="btn btn-outline-light" to="/addproducto">Add Producto</Link>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
